--insertando curp de supervizores, donde un supervizor debe ser mayor a 28 aos
DECLARE @t INT
SET @t = 1
WHILE @t < 500
BEGIN
UPDATE T6.dbo.Supervizar
SET curps = (
	SELECT TOP 1 curp 
	FROM T6.dbo.Empleado
	WHERE fecha_nac > '1990-01-01'
	ORDER BY NEWID()
) WHERE SupervizarID = @t
SET @t = @t + 1
END
